import React from "react";
import { Bar } from "react-chartjs-2";

const TestA = (props) => {
  const entries = props.filteredEntries;

  //   totalAttendeeCount = filteredEntries
  //   .map((entry) => entry.attendee_count)
  //   .reduce((accumulator, runningTotal) => accumulator + runningTotal);
  // }

  const times = entries.map((entry) => entry.time.slice(0, 4));
  const counts = entries.map((entry) => entry.attendee_count);
  const combinedB = [];
  for (let i = 0; i < entries.length; i++) {
    combinedB.push({ x: `${times[i]}0`, y: counts[i] });
  }

  const holder = {};

  combinedB.forEach(function (a) {
    if (holder.hasOwnProperty(a.x)) {
      holder[a.x] = holder[a.x] + a.y;
    } else {
      holder[a.x] = a.y;
    }
  });

  const accumulated = [];

  for (const prop in holder) {
    accumulated.push({ x: prop, y: holder[prop] });
  }

  let earliestHour = "";
  let latestHour = "";
  if (accumulated.length != 0) {
    earliestHour = parseInt(accumulated[0].x);
    latestHour = parseInt(accumulated[accumulated.length - 1].x) + 1;
  }

  const timeSpacedA = [];
  for (let j = earliestHour; j < latestHour; j++) {
    for (let i = 0; i < 6; i++) {
      if (j < 10) {
        timeSpacedA.push(`0${j}:${i}0`);
      } else {
        timeSpacedA.push(`${j}:${i}0`);
      }
    }
  }

  function barValue(x) {
    for (let each of accumulated) {
      if (x === each.x) {
        return each.y;
      }
    }
    return 0;
  }

  return (
    <div>
      <Bar
        type="bar"
        data={{
          labels: timeSpacedA.map((v) => v),
          datasets: [
            {
              backgroundColor: "#000",
              borderWidth: 2,
              fill: false,
              data: timeSpacedA.map((v) => barValue(v)),
            },
          ],
        }}
        options={{
          responsive: true,
          legend: {
            display: false,
          },
          scales: {
            xAxes: [
              {
                display: true,
                ticks: {
                  maxTicksLimit: (latestHour - earliestHour + 1),
                },
              },
            ],
            yAxes: [
              {
                display: true,
                type: "linear",
              },
            ],
          },
        }}
      />
    </div>
  );
};

export default TestA;
